import React, { Component } from "react";
import { GridList, Grid, Container, Button } from "@material-ui/core";

class Cart extends Component {
  render() {
    return (
      <Container>
        <h2>Cart</h2>

        <GridList
          cellHeight={200}
          style={{ marginRight: 100, marginLeft: 100 }}
          cols={1}
        >
          {["white", "yellow", "blue"].map(color => (
            <Grid container direction="row" style={{ background: color }}>
              <img
                src="https://salt.tikicdn.com/cache/175x175/ts/product/9c/ad/e4/1efb61539a6adcf2da14bd70b21ddf58.jpg"
                alt="Cart"
              />
              <Grid
                style={{
                  justifyContent: "flex-start",
                  alignItems: "flex-start",
                  alignContent: "stretch"
                }}
                direction="column"
              >
                <h4>Cà phê Sôcôla</h4>
                <h5>Information</h5>
                <Button style={{ color: "red" }}>Delete</Button>
              </Grid>
              <h4>36.000đ</h4>
            </Grid>
          ))}
        </GridList>
      </Container>
    );
  }
}

export default Cart;

